import React from 'react';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import { Container, Paper } from '@mui/material';
import Button from '@mui/material/Button';
import TableContainer from '@mui/material/TableContainer';
import { Link } from 'react-router-dom';
import '../index.css';

const criterias = [
  {
    value: 'description',
    label: 'Description',
  },
  {
    value: 'author',
    label: 'Author',
  },
];

export default function Data() {
  const myStyle = {
    backgroundImage:
      "url('https://wallpapercave.com/wp/wp4748437.jpg')",
    // backgroundColor: "#eb8934",
    backgroundSize: 'cover',
    backgroundRepeat: 'repeat',
  }
  var description = ""
  var author = ""
  const [Search, setSearch] = React.useState('')
  const [Keyword, setKeyword] = React.useState('')
  const [searchResults, setSearchResults] = React.useState([])
  const handleClick = (e) => {
    if (Search) {
      if (Keyword === "description") {
        description = Search;
        author = '';
      } else {
        author = Search;
        description = '';
      }
      const url = `http://localhost:8080/search?author=${author}&description=${description}&uniqueMenuId=true`;
      fetch(url)
        .then(response => response.json())
        .then(data => {
          setSearchResults(data);
        })
        .catch(error => {
          console.error('Error fetching search results:', error);
        });
    }

  };

  return (
    <Container>
      <div style={{ height: "90px" }} />
      <div

      style={{display : 'grid',gridTemplateColumns : '1fr 1fr'}}
      >
        <Paper elevation={3}
          style={{
            width: 'fit-content', height: 'fit-content',
            display: 'grid', gridTemplateColumns: '1fr',
            padding: '2em', marginBottom: '2em'
          }}
        >
          <form
            component="form"
            noValidate
            autoComplete="off"
          >
            <TextField
              id="filled-select-currency"
              style={{ marginRight: '0.5em', width: 'fit-content' }}
              select
              label="Select"
              defaultValue="Keywords"
              helperText="Search Category"
              variant="filled"
              value={Keyword}
              onChange={(e) => setKeyword(e.target.value)}
            >
              {criterias.map((option) => (
                <MenuItem key={option.value} value={option.value}>
                  {option.label}
                </MenuItem>
              ))}
            </TextField>
            <TextField
              required
              id="filled-required"
              style={{ width: 'fit-content' }}
              label="Required"
              variant="filled"
              value={Search}
              onChange={(e) => setSearch(e.target.value)}
            />
          </form>
          <Button variant="contained" disabled={!{ Search }} onClick={handleClick}
            style={{ width: 'fit-content', margin: '2em' }}
          >
            Search
          </Button>
        </Paper>

        <div>
          {searchResults.map((result) => (
            <div key={result.id} className="box-container">
              {/* Render the content of each Data object */}
              <TableContainer component={Paper} sx={{ maxWidth: '30vw', margin: 'auto', marginBottom: '2em' }}>
                <Link to={`/details/${result.menu.menuId}`}>
                  <table sx={{ minWidth: 650 }} aria-label="simple table">
                    <tbody>
                      <tr style={{display : 'grid',gridTemplateColumns : '1fr 1fr'}}>
                        <td><strong>Author</strong></td>
                        <td><span style={{ fontSize: '1em', }}>
                          {result.author}</span></td>
                      </tr>
                      <tr>
                        <td><strong>Department</strong></td>
                        <td><span style={{ fontSize: '1em', }}>
                          {result.menu.application.function.department.departmentName}</span></td>
                      </tr>
                      <tr>
                        <td><strong>Function</strong></td>
                        <td><span style={{ fontSize: '1em', }}>
                          {result.menu.application.function.functionName}</span></td>
                      </tr>
                      <tr>
                        <td><strong>Application</strong></td>
                        <td><span style={{ fontSize: '1em', }}>
                          {result.menu.application.applicationName}</span></td>
                      </tr>
                      <tr>
                        <td><strong>Menu</strong></td>
                        <td><span style={{ fontSize: '1em', }}>{result.menu.menuName}</span></td>
                      </tr>
                      <tr>
                        <td><strong>Description</strong></td>
                        <td><span style={{ fontSize: '1em', }}>{result.menu.description}</span></td>
                      </tr>
                    </tbody>
                  </table>
                </Link>
              </TableContainer>

            </div>
          ))}
        </div>
      </div>
      <div style={{ height: "30px" }} />
    </Container>
  );
}
